#include "solution.h"

#include <chrono>
#include <iostream>

void runTimedTest(int testcase, int m, int n, const std::vector<std::vector<int>>& prices) {
    std::cout << "Example " << testcase << ":\t";

    Solution solution;

    auto t1 = std::chrono::high_resolution_clock::now();
    auto money = solution.sellingWood(m, n, prices);
    auto t2 = std::chrono::high_resolution_clock::now();

    auto duration = duration_cast<std::chrono::microseconds>(t2 - t1);
    std::cout << money << " (" << duration << ")\n";
}

